$(document).ready(function() {
	$('.carousel').carousel({
	  interval: 5000
	})       

});





/* Adjust height
======================================= */

var resizeSlide = function(){
	var wh = $(window).height();
	var ww = $(window).width();

	if(ww < 480){
		var slideH = Math.round(wh/3);
		$('.page-slider .page-slide, .page-slider').css('height',slideH).css('max-height','480px');	
		
	}else {
		var slideH = Math.round(wh/2);
		$('.page-slider .page-slide, .page-slider').css('height',slideH).css('max-height','480px');	
	}

};

$(window).resize(resizeSlide);
$(document).ready(resizeSlide);
$(document).ready(function() {
	$( ".ttl-brandnew, .main-logo.shadow, .tagline, .footer-symbol" ).css( "display","none");
});


$(window).load(function() {
	setTimeout(
		function(){
			  $( ".ttl-brandnew" ).fadeIn(800)
		},2000);
	setTimeout(
		function(){
			  $( ".main-logo.shadow" ).fadeIn(2000);
		},500);		
	setTimeout(
		function(){
			  $( ".tagline, .footer-symbol" ).fadeIn(2000);
		},2000);		

});


$(document).ready(function() {
	$('.enter-site').click(function(){
		$('.pageheader').addClass('fadeinfromside');

		$('.hp-row').addClass('fadeinfromside');
	});
});
