/* Mobile nav
======================================= */


$(document).ready(function(){
	$('#mbl-navopen').click(function(){

		if($(this).hasClass('open')){
			$(this).removeClass('open');
			$('.mbl-nav').fadeOut();

			$('.main').removeClass('navopen');




		}else {
			$(this).addClass('open');
			$('.mbl-nav').fadeIn();		
			$('.main').addClass('navopen');

		}
	})
});
/* Sticky nav
======================================= */

//pages
$(document).ready(function(){
	$(window).scroll(
		function() {
		    if(($(this).scrollTop() > 0)) {
				$('body.page .top-header').not('body.home .top-header').addClass("sticky");

		    }else {
				$('body.page .top-header').not('body.home .top-header').removeClass("sticky");
			}
		}
	);
});



//home
$(document).ready(function(){
	var breakpoint = $('.spl-cont').height() + 20;

	$(window).scroll(

		function() {
		    if(($(this).scrollTop() > breakpoint)) {
				$('body.home .top-header').addClass("sticky");
				$('body.home').addClass("stickyon");


		    }else {
				$('body.home .top-header').removeClass("sticky");
				$('body.home').removeClass("stickyon");

			}
		}
	);
});


/* Scroll to
======================================= */

$('a.scrollto, a[title="register"]').click(function(e){
	var link = $(this).attr('href');
	var firstCharacter = link.charAt(0);
	var destination = link.substr(1);

	if(firstCharacter === "#"){
		e.preventDefault();
		$('html, body').animate({
			scrollTop: $(link).offset().top
		}, 500);
	}	
});
